import React from 'react';
import './App.css';
// import 'pretty-checkbox';
class CodeCalender extends React.Component{
    constructor(props){
        super(props);
        this.state={
            result:{},
            ongoing:[],
            upcoming:[],

        };
    }
//    componentDidMount=()=>{
//        fetch('http://contesttrackerapi.herokuapp.com/android/').then((res)=>{
//            return res.json();
//        }).then((data)=>{
//         console.log(data)
//        })
//    }
    componentDidMount=()=>{
        this.getContestData();
    }
    getContestData=()=>{
       fetch('http://contesttrackerapi.herokuapp.com/android/').then((res)=>{
           return res.json();
       }).then((data)=>{
           console.log(data.result.ongoing);
           this.setState({
               ongoing : data.result.ongoing
           })
           console.log(data.result.upcoming);
           this.setState({
               upcoming:data.result.upcoming
           })
       })
   }
    render(){
        return(
                <div>
                        <div className="cb">
                        <label class="container">One
                                <input type="checkbox" checked="checked"/>
                                <span class="checkmark"></span>
                         </label>
                        </div>
                        {/* <div className="">
                            <button type="button" className="btn btn-outline-success button1"><h4>HACKERRANK</h4></button>
                        </div>
                        <div className="">
                            <button type="button" className="btn btn-outline-success button2"><h4>HACKER EARTH</h4></button>
                        </div>
                        <div className="">
                            <button type="button" className="btn btn-outline-success button3"><h4>CODECHEF</h4></button>
                        </div>
                        <div className="">
                             <button type="button" className="btn btn-outline-success button4"><h4>CODEFORCES</h4></button>
                        </div> */}
                            <div className="hack">
                                <div className="upcmng">
                                <h2>ONGOING CONTEST</h2>
                                </div>

                                {/* {this.state.ongoing.map((data, index)=>(
                                    <div className="oneBox">
                                            <p>Name:{data.Name}</p>
                                            <p>EndTime:{data.EndTime}</p>
                                            <p>Platform:{data.Platform}</p>
                                            {data.challenge_type ? ( <p>challenge_type:{data.challenge_type}</p>) : null}
                                            <p>url:{data.url}</p>
                                    </div>  

                                ))} */}

                            </div>
                            <div className="hack">
                                    <div className="upcmng">
                                        <h2>UPCOMING CONTEST</h2>
                                    </div>
                                {this.state.upcoming.map((data, index)=>(
                                    <div className="oneBox">
                                            <p>Duration:{data.Duration}</p>
                                            <p>EndTime:{data.EndTime}</p>
                                            <p>Name:{data.Name}</p>
                                            <p>Platform:{data.Platform}</p>
                                            <p>StartTime:{data.StartTime}</p>
                                            <p>url:{data.url}</p>
                                    </div>
                                ))}
                            </div>

            </div>
        );
    }
}
export default CodeCalender;
